/*
-- Query: SELECT a.id, a.product_id, "advancedetruct_2" as field, 
if(b.old_value is "00" or b.old_value = '', concat(a.old_value,0), if(a.old_value ='', b.old_value, concat(a.old_value, b.old_value))) as old_value, 
if(b.new_value is "00" or b.new_value = '', concat(a.new_value,0), if(a.new_value ='', b.new_value, concat(a.new_value, b.new_value))) as new_value, 
a.group, a.user_id, a.created_at
FROM (SELECT * FROM admin_pizo.lck_product_change_log where field = "balcony_number") as a
LEFT JOIN (SELECT * FROM admin_pizo.lck_product_change_log where field = "elevator") as b
ON a.user_id = b.user_id and a.created_at = b.created_at
order by a.created_at
